webpackJsonp([0x5c01ea278a70],{721:function(n,a){n.exports={data:{markdownRemark:{html:'<p><em>Check out the Victory docs <a href="https://formidable.com/open-source/victory/">here</a></em>.</p>\n<p>It&#8217;s been a while since the release of Victory 0.9.0 back in June, so we&#8217;re excited to add several new features and bug fixes in order to continue making the creation of D3 charts in React as painless as possible. This post will explore some of the highlights of the new release, including cool new features like VictoryCandlestick, VictoryErrorBar, and the highly anticipated VictoryNative! Note that this version of Victory has breaking changes due to changes in default styles and some default props.</p>\n<h2>Features</h2>\n<p>We&#8217;ve added two new components to VictoryChart: VictoryErrorBar and VictoryCandlestick. They&#8217;re both as composable and flexible as the components that came before them, giving you a wider range of chart types that you can put together using Victory.</p>\n<h4>VictoryCandlestick</h4>\n<img src="/ezgif.com-optimize-2-52c5b5a67f2f3d9a02d7a8683089a1d7.gif" alt="candlestick">\n<figure id="media-701" style="max-width:400px; margin:0 auto;">\n  <span class="gatsby-resp-image-wrapper" style="position: relative; display: block; z-index: 0 !important;; max-width: 537px; margin-left: auto; margin-right: auto;">\n    <span class="gatsby-resp-image-background-image" style="padding-bottom: 62.19739292364991%; position: relative; bottom: 0; left: 0; background-image: url(&apos;data:image/png;base64,&apos;); background-size: cover; display: block;">\n      <img class="gatsby-resp-image-image" style="width: 100%; height: 100%; margin: 0; vertical-align: middle; position: absolute; top: 0; left: 0; box-shadow: inset 0px 0px 0px 400px transparent;" alt=" " title="" src="/static/Screen-Shot-2016-08-04-at-10.37.59-AM-7bf8e228812c17b66e5434acabcd9fce-715cf.png" srcset="/static/Screen-Shot-2016-08-04-at-10.37.59-AM-7bf8e228812c17b66e5434acabcd9fce-61a1f.png 200w,\n/static/Screen-Shot-2016-08-04-at-10.37.59-AM-7bf8e228812c17b66e5434acabcd9fce-bedcd.png 400w,\n/static/Screen-Shot-2016-08-04-at-10.37.59-AM-7bf8e228812c17b66e5434acabcd9fce-715cf.png 537w" sizes="(max-width: 537px) 100vw, 537px">\n    </span>\n  </span>\n  </figure>\n<p><a href="https://github.com/FormidableLabs/victory-chart/tree/master/src/components/victory-candlestick">VictoryCandlestick</a> takes data in the format <code>&#91;{x: value, open: value, high: value, low: value}]</code>. Data accessor props for all values are included. Since candlestick charts are most commonly used for commodity and stock price tracking, open and close are the opening and closing price for a given period of time, while high and low are the absolute high point and low point that the cost reached over that same period. Check out <a href="https://formidable.com/open-source/victory/recipes/candlestick-dashboard">this example</a> to see how you can use Candlestick in conjunction with other Victory components!</p>\n<h4>VictoryErrorBar</h4>\n<img src="/errorbargif-4f85e89bbb95d6387057cb1b31ce8709.gif" alt="">\n<figure id="media-703" style="max-width:400px; margin:0 auto;">\n  <span class="gatsby-resp-image-wrapper" style="position: relative; display: block; z-index: 0 !important;; max-width: 800px; margin-left: auto; margin-right: auto;">\n    <span class="gatsby-resp-image-background-image" style="padding-bottom: 55.70342205323193%; position: relative; bottom: 0; left: 0; background-image: url(&apos;data:image/png;base64,&apos;); background-size: cover; display: block;">\n      <img class="gatsby-resp-image-image" style="width: 100%; height: 100%; margin: 0; vertical-align: middle; position: absolute; top: 0; left: 0; box-shadow: inset 0px 0px 0px 400px transparent;" alt="Screen Shot 2016 08 04 at 10 37 35 AM" title="" src="/static/Screen-Shot-2016-08-04-at-10.37.35-AM-66f04ba28a45d1805f15acc592d5af15-fc76f.png" srcset="/static/Screen-Shot-2016-08-04-at-10.37.35-AM-66f04ba28a45d1805f15acc592d5af15-290b0.png 200w,\n/static/Screen-Shot-2016-08-04-at-10.37.35-AM-66f04ba28a45d1805f15acc592d5af15-14201.png 400w,\n/static/Screen-Shot-2016-08-04-at-10.37.35-AM-66f04ba28a45d1805f15acc592d5af15-fc76f.png 800w,\n/static/Screen-Shot-2016-08-04-at-10.37.35-AM-66f04ba28a45d1805f15acc592d5af15-c5fa9.png 1052w" sizes="(max-width: 800px) 100vw, 800px">\n    </span>\n  </span>\n  </figure>\n<p><a href="https://github.com/FormidableLabs/victory-chart/tree/master/src/components/victory-errorbar">VictoryErrorBar</a> expects data in the form [{x: value, y: value, errorX: err, errorY: err}], where err is a number or two-value array for asymmetric errors. The component includes data accessor props for x, y, errorX, and errorY. VictoryErrorBar can be used on its own or with VictoryChart, and looks great combined with other chart types like VictoryScatter.</p>\n<h4>VictoryTheme</h4>\n<figure id="media-705" style="max-width:400px; margin:0 auto;">\n  <span class="gatsby-resp-image-wrapper" style="position: relative; display: block; z-index: 0 !important;; max-width: 396px; margin-left: auto; margin-right: auto;">\n    <span class="gatsby-resp-image-background-image" style="padding-bottom: 101.26262626262626%; position: relative; bottom: 0; left: 0; background-image: url(&apos;data:image/png;base64,&apos;); background-size: cover; display: block;">\n      <img class="gatsby-resp-image-image" style="width: 100%; height: 100%; margin: 0; vertical-align: middle; position: absolute; top: 0; left: 0; box-shadow: inset 0px 0px 0px 400px transparent;" alt="Screen Shot 2016 08 04 at 11 14 24 AM" title="" src="/static/Screen-Shot-2016-08-04-at-11.14.24-AM-f178425fd047dc7fb41433d8517730cf-b186f.png" srcset="/static/Screen-Shot-2016-08-04-at-11.14.24-AM-f178425fd047dc7fb41433d8517730cf-a2bd1.png 200w,\n/static/Screen-Shot-2016-08-04-at-11.14.24-AM-f178425fd047dc7fb41433d8517730cf-b186f.png 396w" sizes="(max-width: 396px) 100vw, 396px">\n    </span>\n  </span>\n  </figure>\n<p>Another exciting thing that we&#8217;ve added is theme support for Victory components! All components can now take a theme prop, which is an object that should be structured approximately like so:</p>\n<div class="gatsby-highlight">\n      <pre class="language-js"><code class="language-js"><span class="token keyword">export</span> <span class="token keyword">default</span> <span class="token punctuation">{</span>\n  area<span class="token punctuation">:</span> <span class="token punctuation">{</span>\n    data<span class="token punctuation">:</span> <span class="token punctuation">{</span><span class="token punctuation">}</span><span class="token punctuation">,</span>\n    labels<span class="token punctuation">:</span> <span class="token punctuation">{</span><span class="token punctuation">}</span><span class="token punctuation">,</span>\n    parent<span class="token punctuation">:</span> <span class="token punctuation">{</span><span class="token punctuation">}</span>\n  <span class="token punctuation">}</span><span class="token punctuation">,</span>\n  axis<span class="token punctuation">:</span> <span class="token punctuation">{</span>\n    axis<span class="token punctuation">:</span> <span class="token punctuation">{</span><span class="token punctuation">}</span><span class="token punctuation">,</span>\n    axisLabel<span class="token punctuation">:</span> <span class="token punctuation">{</span><span class="token punctuation">}</span><span class="token punctuation">,</span>\n    grid<span class="token punctuation">:</span> <span class="token punctuation">{</span><span class="token punctuation">}</span><span class="token punctuation">,</span>\n    ticks<span class="token punctuation">:</span> <span class="token punctuation">{</span><span class="token punctuation">}</span><span class="token punctuation">,</span>\n    tickLabels<span class="token punctuation">:</span> <span class="token punctuation">{</span><span class="token punctuation">}</span>\n  <span class="token punctuation">}</span><span class="token punctuation">,</span>\n  bar<span class="token punctuation">:</span> <span class="token punctuation">{</span>\n    data<span class="token punctuation">:</span> <span class="token punctuation">{</span><span class="token punctuation">}</span><span class="token punctuation">,</span>\n    labels<span class="token punctuation">:</span> <span class="token punctuation">{</span><span class="token punctuation">}</span><span class="token punctuation">,</span>\n    parent<span class="token punctuation">:</span> <span class="token punctuation">{</span><span class="token punctuation">}</span>\n  <span class="token punctuation">}</span><span class="token punctuation">,</span>\n  candlestick<span class="token punctuation">:</span> <span class="token punctuation">{</span>\n    data<span class="token punctuation">:</span> <span class="token punctuation">{</span><span class="token punctuation">}</span><span class="token punctuation">,</span>\n    labels<span class="token punctuation">:</span> <span class="token punctuation">{</span><span class="token punctuation">}</span><span class="token punctuation">,</span>\n    parent<span class="token punctuation">:</span> <span class="token punctuation">{</span><span class="token punctuation">}</span><span class="token punctuation">,</span>\n    props<span class="token punctuation">:</span> <span class="token punctuation">{</span><span class="token punctuation">}</span>\n  <span class="token punctuation">}</span><span class="token punctuation">,</span>\n  errorbar<span class="token punctuation">:</span> <span class="token punctuation">{</span>\n    data<span class="token punctuation">:</span> <span class="token punctuation">{</span><span class="token punctuation">}</span><span class="token punctuation">,</span>\n    labels<span class="token punctuation">:</span> <span class="token punctuation">{</span><span class="token punctuation">}</span><span class="token punctuation">,</span>\n    parent<span class="token punctuation">:</span> <span class="token punctuation">{</span><span class="token punctuation">}</span>\n  <span class="token punctuation">}</span><span class="token punctuation">,</span>\n  line<span class="token punctuation">:</span> <span class="token punctuation">{</span>\n    data<span class="token punctuation">:</span> <span class="token punctuation">{</span><span class="token punctuation">}</span><span class="token punctuation">,</span>\n    labels<span class="token punctuation">:</span> <span class="token punctuation">{</span><span class="token punctuation">}</span><span class="token punctuation">,</span>\n    parent<span class="token punctuation">:</span> <span class="token punctuation">{</span><span class="token punctuation">}</span>\n  <span class="token punctuation">}</span><span class="token punctuation">,</span>\n  pie<span class="token punctuation">:</span> <span class="token punctuation">{</span>\n    props<span class="token punctuation">:</span> <span class="token punctuation">{</span><span class="token punctuation">}</span><span class="token punctuation">,</span>\n    style<span class="token punctuation">:</span> <span class="token punctuation">{</span>\n      data<span class="token punctuation">:</span> <span class="token punctuation">{</span><span class="token punctuation">}</span><span class="token punctuation">,</span>\n      labels<span class="token punctuation">:</span> <span class="token punctuation">{</span><span class="token punctuation">}</span><span class="token punctuation">,</span>\n      parent<span class="token punctuation">:</span> <span class="token punctuation">{</span><span class="token punctuation">}</span>\n    <span class="token punctuation">}</span>\n  <span class="token punctuation">}</span><span class="token punctuation">,</span>\n  scatter<span class="token punctuation">:</span> <span class="token punctuation">{</span>\n    data<span class="token punctuation">:</span> <span class="token punctuation">{</span><span class="token punctuation">}</span><span class="token punctuation">,</span>\n    labels<span class="token punctuation">:</span> <span class="token punctuation">{</span><span class="token punctuation">}</span>\n    parent<span class="token punctuation">:</span> <span class="token punctuation">{</span><span class="token punctuation">}</span>\n  <span class="token punctuation">}</span><span class="token punctuation">,</span>\n  props<span class="token punctuation">:</span> <span class="token punctuation">{</span><span class="token punctuation">}</span>\n<span class="token punctuation">}</span><span class="token punctuation">;</span></code></pre>\n      </div>\n<p>To see more specifics, check out <a href="https://github.com/FormidableLabs/victory-core/blob/master/src/victory-theme/material.js">Material Theme</a>, which is included in VictoryCore. Custom themes are supported as well, as long as they have the same general structure!</p>\n<h4>domainPadding</h4>\n<p>Finally, the <code>domainPadding</code> prop has also gotten some upgrades &#8211; it&#8217;s now available on all components that are compatible with VictoryChart, it supports negative and asymmetric values, and it&#8217;s applied automatically to grouped bar charts to prevent charts from overflowing the axis.</p>\n<p>For a complete overview of what&#8217;s new, check out the <a href="https://github.com/FormidableLabs/victory/blob/master/CHANGELOG.md">Victory Changelog</a>.</p>\n<h2>Performance Improvements</h2>\n<p>We made it easier to use Victory with large datasets by making some low-hanging performance improvements, including replacing <code>Object.assign</code> with the lodash <code>assign</code> method, and replacing <code>map</code> and <code>reduce</code> methods with length-cached <code>for</code> loops in methods that are responsible for rendering elements.</p>\n<h2>Bug Fixes</h2>\n<p>Key bug fixes include <a href="https://github.com/FormidableLabs/victory-chart/pull/317">fixing various issues</a> that arose when using log scales, better handling of <a href="https://github.com/FormidableLabs/victory-chart/pull/318">cross axis positioning</a> when using dates as axis values, and improving how chart components handle being passed empty data arrays or single data points.</p>\n<h2>And&#8230; Announcing VictoryNative!</h2>\n<p>Create the same Victory SVG charts that you love in React Native. See the repo <a href="https://github.com/FormidableLabs/victory-native">here</a>.</p>\n<img src="/victory-native-31333826442856cf726944697de725ab.gif" alt="victory-native">\n<p>The API for VictoryNative is identical to Victory, so you can do all the same stuff that you love in the browser on iOS or Android. We were excited to see how little code we needed to write in order to adapt the components to be usable in React Native.</p>\n<p>If you have any questions or problems you&#8217;d like us to address, create an issue in the <a href="https://github.com/FormidableLabs/victory-native">VictoryNative repo</a> or the <a href="https://github.com/FormidableLabs/victory">Victory repo</a>, or contact us on our <a href="https://gitter.im/FormidableLabs/victory">Gitter channel</a>.</p>\n<p>Thanks for using Victory!</p>\n<p><em>Check out the Victory docs <a href="https://formidable.com/open-source/victory/">here</a></em>.</p>\n<div>\n          <div\n            class="gatsby-resp-iframe-wrapper"\n            style="padding-bottom: 9.090909090909092%; position: relative; height: 0; overflow: hidden;"\n          >\n            <iframe src="https://ghbtns.com/github-btn.html?user=formidablelabs&amp;repo=victory&amp;type=star&amp;count=true&amp;size=large" frameborder="0" scrolling="0" style="\n            position: absolute;\n            top: 0;\n            left: 0;\n            width: 100%;\n            height: 100%;\n          "></iframe>\n          </div>\n          </div>\n<div>\n          <div\n            class="gatsby-resp-iframe-wrapper"\n            style="padding-bottom: 9.090909090909092%; position: relative; height: 0; overflow: hidden;"\n          >\n            <iframe src="https://ghbtns.com/github-btn.html?user=ebrillhart&amp;type=follow&amp;count=true&amp;size=large" frameborder="0" scrolling="0" style="\n            position: absolute;\n            top: 0;\n            left: 0;\n            width: 100%;\n            height: 100%;\n          "></iframe>\n          </div>\n          </div>',fields:{slug:"/blog/2016/08/05/announcing-victory-0-10-2-and-victorynative/"},frontmatter:{id:19,authorId:3,categoryIds:[10,5,1,8],date:"2016-08-05",pageDescription:"Announcement of the newest version of Victory, a React OSS library for d3-based charting components.",pageKeywords:"",pageTitle:"",path:"/2016/08/05/announcing-victory-0-10-2-and-victorynative/",title:"Announcing Victory 0.10.2 and VictoryNative"}}},pathContext:{slug:"/blog/2016/08/05/announcing-victory-0-10-2-and-victorynative/",prev:{fields:{slug:"/blog/2016/07/25/let-the-url-do-the-talking-part-3-empower-the-url-with-redux-little-router/"},frontmatter:{authorId:7,categoryIds:[5,1],date:"2016-07-25",id:18,title:"Let the URL do the Talking, Part 3: Empower the URL with Redux Little Router"}}}}}});